import {BrowserRouter as Router, Routes, Route, Navigate} from 'react-router-dom'
import Login from '../pages/Login';
import Home from '../pages/Home';
import { Register } from '../pages/Register';
import '../styles/style.css';

import { Mapas } from '../pages/Mapas'       
import Categorias from '../pages/Categorias';
import ByCategory from '../pages/ByCategory';
import Dashboard from '../pages/Dashboard';
import Navbar from '../components/Navbar/Navbar';
import { Auth } from '../hooks/useAuth';
import { NotFound } from '../components/NotFound/NotFound';
import { Project } from '../pages/Project';

function Routing(){
    const { err, check } = Auth('/api/perfil');

    return(
        <Router>
            <Routes>
                <Route path='/' element={<div><Navbar status={err}/><Home/></div>}/>

                <Route path='/mapas' element={<Mapas/>}/>
                <Route path='/mapas/:id' element={<div><Navbar status={err} f={'sticky'}/><Dashboard/></div>}/>


                <Route path='/categorias' element={<div><Navbar status={err}/><Categorias/></div>}/>
                <Route path='/categorias/:id' element={<div><Navbar status={err}/><ByCategory/></div>}/>

                <Route path='/Saiba_mais' element={<div><Navbar status={err}/><Project/></div>}/>

                <Route path="*" element={<div><Navbar status={err}/><NotFound/></div>}/>

                <Route path='/login'
                    element={{...!err && check ? <Navigate to='/'/> : err && !check ? 
                    <div><Navbar status={err}/><Login/></div> :<div></div>}}
                />
                <Route path='/register' 
                    element={{...!err  && check ? <Navigate to='/' replace /> : err && !check ?
                    <div><Navbar status={err}/> <Register/> </div>: <div></div>}}
                />               
            </Routes>
        </Router>
    )

}
export default Routing;
